func:
online = flow.get('trainstation-online')

unixts = Math.floor(+new Date() / 1000)

for (const [key, value] of online) {
    if (value + 5 < unixts) {
        online.delete(key)
        msg.payload = {}
        msg.payload.name = key
        return msg;
    }
}

